import '../css/app.css';
import React from 'react';
import Blurb from './Blurb';

class App extends React.Component {

	render(){
		return (
			<div className="ui middle aligned center aligned grid">
				<div className="row">
					<div className="column">
						<h1>Testing portfolio</h1>
						<Blurb />
					</div>
				</div>
			</div>
		);
	}
}

export default App;
